import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './App.css';

function App() {
  const [meals, setMeals] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const [formData, setFormData] = useState({
    mealId: '',
    userName: '',
    mealName: '',
    calories: '',
    dateEntered: '',
    cuisineType: ''
  });

  // Configure Axios defaults
  axios.defaults.baseURL = 'http://localhost:8080';
  axios.defaults.headers.common['Content-Type'] = 'application/json';

  useEffect(() => {
    fetchMeals();
  }, []);

  const fetchMeals = async () => {
    setLoading(true);
    setError(null);
    try {
      const response = await axios.get('/api/meals');
      setMeals(response.data);
    } catch (error) {
      setError(error.response?.data?.message || 'Error fetching meals. Please try again.');
      console.error('Error fetching meals:', error);
    } finally {
      setLoading(false);
    }
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData(prevState => ({
      ...prevState,
      [name]: value
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError(null);
    try {
      await axios.post('/api/meals', formData);
      setFormData({
        mealId: '',
        userName: '',
        mealName: '',
        calories: '',
        dateEntered: '',
        cuisineType: ''
      });
      await fetchMeals();
    } catch (error) {
      setError(error.response?.data?.message || 'Error adding meal. Please try again.');
      console.error('Error adding meal:', error);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>Meal Management System</h1>
      </header>
      <main>
        {error && (
          <div className="error-message">
            {error}
          </div>
        )}
        <div className="form-container">
          <h2>Add New Meal</h2>
          <form onSubmit={handleSubmit}>
            <div className="form-group">
              <label>Meal ID:</label>
              <input
                type="text"
                name="mealId"
                value={formData.mealId}
                onChange={handleInputChange}
                required
                disabled={loading}
              />
            </div>
            <div className="form-group">
              <label>User Name:</label>
              <input
                type="text"
                name="userName"
                value={formData.userName}
                onChange={handleInputChange}
                required
                disabled={loading}
              />
            </div>
            <div className="form-group">
              <label>Meal Name:</label>
              <input
                type="text"
                name="mealName"
                value={formData.mealName}
                onChange={handleInputChange}
                required
                disabled={loading}
              />
            </div>
            <div className="form-group">
              <label>Calories:</label>
              <input
                type="number"
                name="calories"
                value={formData.calories}
                onChange={handleInputChange}
                required
                disabled={loading}
              />
            </div>
            <div className="form-group">
              <label>Date Entered:</label>
              <input
                type="date"
                name="dateEntered"
                value={formData.dateEntered}
                onChange={handleInputChange}
                required
                disabled={loading}
              />
            </div>
            <div className="form-group">
              <label>Cuisine Type:</label>
              <input
                type="text"
                name="cuisineType"
                value={formData.cuisineType}
                onChange={handleInputChange}
                required
                disabled={loading}
              />
            </div>
            <button type="submit" disabled={loading}>
              {loading ? 'Adding...' : 'Add Meal'}
            </button>
          </form>
        </div>

        <div className="meals-list">
          <h2>Meals List</h2>
          {loading ? (
            <div className="loading">Loading meals...</div>
          ) : (
            <table>
              <thead>
                <tr>
                  <th>Meal ID</th>
                  <th>User Name</th>
                  <th>Meal Name</th>
                  <th>Calories</th>
                  <th>Date Entered</th>
                  <th>Cuisine Type</th>
                </tr>
              </thead>
              <tbody>
                {meals.map((meal) => (
                  <tr key={meal.mealId}>
                    <td>{meal.mealId}</td>
                    <td>{meal.userName}</td>
                    <td>{meal.mealName}</td>
                    <td>{meal.calories}</td>
                    <td>{meal.dateEntered}</td>
                    <td>{meal.cuisineType}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          )}
        </div>
      </main>
    </div>
  );
}

export default App;
